import numpy as np

def calculate_balance(sequence):
    d = np.sum(sequence)
    return len(sequence) - 2 * d

def compute_difference(sequence):
    N = len(sequence)
    results = []
    for k in range(N):
        shifted_sequence = np.roll(sequence, k)
        agreements = np.sum(sequence == shifted_sequence)
        disagreements = N - agreements
        result = agreements - disagreements
        results.append(result)
    return results

def acr(seq1,seq2):
    N = len(seq2)
    n = len(seq1+seq2)
    results = []
    for k in range(N):
        shifted = np.roll(seq2,k)
        sequence = seq1.extend(shifted.tolist())
        unique_vals = compute_difference(sequence)
        unique_vals = [abs(val) for val in unique_vals]
        acr_max = max(set(unique_vals[1:])) if len(unique_vals) > 1 else 0
        results.append(int(acr_max))

    return results


def compute_acr(binary_sequence):

    unique_vals = compute_difference(binary_sequence)
    unique_vals = [abs(val) for val in unique_vals]
    acr_max = max(set(unique_vals[1:])) if len(unique_vals) > 1 else 0

    return acr_max


from itertools import combinations

import numpy as np

def compute_cross_correlation(seq1, seq2):
    seq1 = np.array(seq1)
    seq2 = np.array(seq2)
    N = len(seq1)
    results = []
    for k in range(N):
        shifted_seq2 = np.roll(seq2, k)
        agreements = np.sum(seq1 == shifted_seq2)
        disagreements = N - agreements
        result = agreements - disagreements
        results.append(int(result))
    return results


def compute_ccr(list_of_binary_sequence):
    ccr_results = {}
    for seq1, seq2 in combinations(list_of_binary_sequence, 2):
        seq1_str = ''.join(str(x) for x in seq1)
        seq2_str = ''.join(str(x) for x in seq2)
        cc = compute_cross_correlation(seq1, seq2)
        ccr_max = max(abs(val) for val in cc)
        ccr_results[(seq1_str, seq2_str)] = ccr_max
    max_pair = max(ccr_results, key=ccr_results.get)
    # print(ccr_results)
    return max_pair,ccr_results[max_pair],ccr_results

def left_circular_shift(seq, shift_amount):
    """
    Performs a left circular shift on the sequence by shift_amount positions.

    Parameters:
    seq (list): List of bits (0 or 1).
    shift_amount (int): Number of positions to shift.

    Returns:
    list: New list representing the circularly shifted sequence.
    """
    n = len(seq)
    # Use modulo to handle shifts larger than sequence length
    shift = shift_amount % n
    # Rotate by slicing and concatenating
    shifted_seq = seq[shift:] + seq[:shift]
    return shifted_seq

